import { Row, Container, Col } from "react-bootstrap";
import Footer from "./Footer";
const Home = () => {
  return (
    <Container>
      <Row>
        <Col sm={12} md={9}>
          <h1>MainContainer</h1>
        </Col>
        <Col sm={0} md={3}>
          <h1>Aside</h1>
        </Col>
      </Row>
      <Footer />
    </Container>
  );
};

export default Home;
